import React from 'react';
import {NavLink} from 'react-router-dom';
import *as ReactBootStrap from "react-bootstrap";
import AboutL from './AboutL';
import {BrowserRouter,Route,Switch,Link} from 'react-router-dom';
// import ABOUT from './Aboutl';
const Navbar2=()=>{
    return (
        <>
        <div className="container-fluid nav-bg ">
            <div className="row">
            <ReactBootStrap.Navbar  variant="dark" defaultActiveKey="/home" className="navn" >
    
    <ReactBootStrap.Nav bg='dark' variant="dark" className="mr-auto" defaultActiveKey="/home">
    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
    
      <ReactBootStrap.NavLink to="/home" className='color' ><h5><b>HOME</b></h5></ReactBootStrap.NavLink>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <ReactBootStrap.NavLink to='/contact' ><h5><b>CONTACT</b></h5></ReactBootStrap.NavLink>
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <ReactBootStrap.NavLink href="#pricing"><h5><b>LANGUAGE</b></h5></ReactBootStrap.NavLink>
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <ReactBootStrap.NavLink href="#pricing"><h5><b>JOB OPPORTUNITY</b></h5></ReactBootStrap.NavLink>
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      <ReactBootStrap.NavLink href="#pricing"><h5><b>BLOG </b></h5></ReactBootStrap.NavLink>
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
      
   
    </ReactBootStrap.Nav>
    
  </ReactBootStrap.Navbar>
</div>
</div>
</>
    );


};
const Routes = (
  <BrowserRouter>
    <div>
      <switch>
        <Route path='/' component={AboutL} exact={true}/>

      </switch>
    </div>
  </BrowserRouter>
)
export default Navbar2;
export {Routes};
